in_source: |
  section .data:
      num1: 1 ; текущее число
      num2: 1 ; следующее число
  section .text:
      lit num1
      push 
      call .print_num ; вывели первое число

      ; программа работает до тех пор, пока не дойдет до лимита инструкций процессора
      .loop:
          call .print_space
          lit num2
          push
          dup
          dup
          call .print_num ; вывод следующего числа
          lit num1
          push
          add ; складываем текущее и предыдушее числа 
          lit num2
          pop ; кладем полученное число на место следующего числа
          lit num1
          pop ; кладем старое значение следующего числа на место текущего числа
          jmp .loop

      .print_num: ; в качестве аргумента подпрограмма принимает число на верхушке стека данных
          lit -1 ; подпрограмма последовательно кладет цифры числа на стек, так что надо знать, где граница данного числа
          switch
          .loop1:
              dup ; текущее значение числа делится на 10 - остаток является следующей цифрой
              lit 10
              switch 
              mod 
              lit 48
              add
              switch
              lit 10
              switch
              div
              jnz .loop1 ; продолжаем делить число до тех пор, пока целочисленное деление не даст 0
          drop
          .loop2: ; идем обратно по стеку данных и выводим число до тех пор, пока не дойдем до -1
              lit -1
              cmp 
              jz .stop1
              drop
              lit out
              pop
              jmp .loop2            
          .stop1:
              drop
              drop
              ret    

      .print_space:
          lit 32
          lit out
          pop
          ret
